import React, {Component} from 'react';

class Text extends Component {
state={
  search:""
};
    render() {
        return (
            <div>
          <p>boghos yev bedrose kaletsin bardez </p>

            </div>
        );
    }

    handleChange = event => {
        const {
            target: { name, value }
        } = event;
        this.setState({ [name]: value });
};
}

export default Text;
